            // DO NOT EDIT ANYTHING BELOW THIS LINE

            var svg = d3.select("svg"),
                width = +svg.attr("width"),
                height = +svg.attr("height")

            // Set the d3 force simulation parameters which will be used to
            // position the nodes relative to each other
            var simulation = d3.forceSimulation()
                // A spring force that will tend to keep linked nodes close together
                .force("link", d3.forceLink()
                    .id(function(d) { return d.id })
                )
                // A repulsion force that will tend to keep nodes away from all other nodes
            	.force('charge', d3.forceManyBody()
                    .strength(-2000)
                    .theta(0.8)
                    .distanceMax(300)
                )
                // A gravitional force that will tend to keep nodes near the centre of the page
                .force("center", d3.forceCenter(width / 2, height / 2))

            function run(graph) {

                // Handles the creation and styling of links between nodes
                var link = svg.append("g")
                    .style("stroke", "#CCCCCC")
                    .selectAll("line")
                    .data(graph.links)
                    .enter()
                    .append("line")

                // Handles the creation and styling of user nodes
                var node = svg.append("g")
                    .attr("class", "nodes")
                    .selectAll("circle")
                    .data(graph.nodes)
                    .enter()
                    .append("circle")
                    .attr("r", 24)
                    .attr("fill", function(d) { return d.color1 })
                    .attr("stroke", function(d) { return d.color2 })
                    .attr("stroke-width", "4px")

                // Handles the creation and styling of node labels
                var label = svg.append("g")
                    .attr("class", "labels")
                    .selectAll("text")
                    .data(graph.nodes)
                    .enter()
                    .append("text")
                    .attr("class", "label")
                    .attr("font-size", "18px")
                    .attr("font-family", "Tahoma, sans-serif")
                    .text(function(d) { return d.name })

                simulation
                    .nodes(graph.nodes)
                    .on("tick", ticked)

                simulation
                    .force("link")
                    .links(graph.links)

                function ticked() {
                    link
                        .attr("x1", function(d) { return d.source.x })
                        .attr("y1", function(d) { return d.source.y })
                        .attr("x2", function(d) { return d.target.x })
                        .attr("y2", function(d) { return d.target.y })

                    node
                        .attr("cx", function(d) { return d.x + 5 })
                        .attr("cy", function(d) { return d.y - 3 })

                    label
                    	.attr("x", function(d) { return d.x })
                        .attr("y", function(d) { return d.y })
                }
            }

            var graph = jsonFile
            run(graph)
